import logo from './logo.svg';
import './App.css';
import React from 'react';
import RoomVisualizer from './components/RoomVisualizer/RoomVisualizer.jsx';

function App() {
    // Define static data directly within the App component
    const roomData = {
        dimensions: {
            length: 120,  // Sample dimensions in feet
            width: 115
        },
        doorPlacement: {
            x: 0,  // Sample coordinates of the door
            y: 95
        },
        windowPlacement: [
            { x: 7, y: 1 },  // Sample coordinates of windows
            { x: 0, y: 2 }
        ]
    };

    return (
        <div className="App">
            <h1>Room Visualizer</h1>
              <h2>Broooooo</h2>
            <RoomVisualizer roomData={roomData} /> {/* Pass the roomData to RoomVisualizer */}
            <h3>thanks</h3>
        </div>
    );
}

export default App;
